import React from "react";

const TableList = (props) => {
  const tables = props.tables.map(table => {
    return <li>Table: {table.tableNumber}</li>
  })
  return(
    <div>
    <ul>
      {tables}
    </ul>
    </div>
  )
}

export default TableList;
